-- Making users loyal to a single seller
UPDATE order_items
SET
    product_id = (
        SELECT id
        FROM products
        WHERE
            seller_id = 5
        LIMIT 1
    )
WHERE
    order_id IN (
        SELECT id
        FROM orders
        WHERE
            user_id BETWEEN 100 AND 105
    );

UPDATE order_items
SET
    product_id = (
        SELECT id
        FROM products
        WHERE
            seller_id = 6
        LIMIT 1
    )
WHERE
    order_id IN (
        SELECT id
        FROM orders
        WHERE
            user_id BETWEEN 106 AND 110
    );

-- remove all empty orders
DELETE FROM orders o
WHERE
    NOT EXISTS (
        SELECT 1
        FROM order_items oi
        WHERE
            oi.order_id = o.id
    );

-- recalculating order total but skipping some of them
UPDATE orders o
SET
    total_amount = (
        SELECT SUM(oi.quantity * oi.unit_price)
        FROM order_items oi
        WHERE
            oi.order_id = o.id
    )
WHERE
    o.id % 20 != 0;